def ifNoExistLink(t):
    t.execute('''CREATE TABLE IF NOT EXISTS links_to_wb_file (
         uuid TEXT PRIMARY KEY,
         link TEXT,
         dtime TEXT)''')


def ifNoExistFile(t):
    t.execute('''CREATE TABLE IF NOT EXISTS wb_file (
         uuid TEXT PRIMARY KEY,
         file TEXT)''')


