def wb_read_Link(uuid):
    # print('-- wb_read_Link uuid', uuid)
    db = sqlite3.connect('baza.db')
    t = db.cursor()
    ifNoExistLink(t)
    t.execute(f"SELECT  dtime, link FROM links_to_wb_file WHERE uuid='{uuid}'")
    ans = t.fetchone()
    db.commit()
    db.close()
    today = date.today()

    # print('=ans=', ans)

    # if ans: ans = ans[0]
    # today = today - timedelta(days=1)
    if not ans or not ans[0] or str(today) != ans[0][:10]:
        print('~~Указанная ссылка на файл не существует')
        return None
    else: return ans[1]

# print('>>>', wb_read_Link('07d341e5efc040eea4a5384109919961'))


def wb_save_file(file, uuid):
    # print('+++ file save len(file), uuid=', len(file), uuid)
    # print('file=', file)
    db = sqlite3.connect('baza.db')
    t = db.cursor()
    ifNoExistFile(t)
    t.execute(f"""INSERT INTO wb_file (uuid, file) 
         VALUES (?,?)
         ON CONFLICT(uuid) DO UPDATE SET file=EXCLUDED.file
         """, (uuid, json.dumps(file)))
    # t.execute("DELETE FROM wb_file ")
    db.commit()
    db.close()

