def wb_read_file(uuid):
    db = sqlite3.connect('baza.db')
    t = db.cursor()
    ifNoExistFile(t)
    t.execute(f"SELECT file FROM wb_file WHERE uuid='{uuid}'")
    # t.execute("DELETE FROM wb_file ")
    ans = t.fetchone()
    if ans: ans = ans[0]
    db.commit()
    db.close()
    # print('         a n s=', ans[-100])
    if ans:
        return json.loads(ans)
    else:
        # 'Файл аналитики не существует'
        return None
